import '@babel/polyfill';
import {displayMap, myPromise} from './mapbox';
import { login, logout } from './login';
import { updateSettings } from './updateSetting';


// DOM ELEMENTS
 const mapBox = document.getElementById('map');
 const loginForm = document.querySelector('.form--login');
 const logOutBtn = document.querySelector('.nav__el--logout');
 const updateBtn = document.querySelector('.form-user-data');
 const updatePassword = document.querySelector('.form-user-settings');
// VALUES
// const email = document.getElementById('email').value;
// const password = document.getElementById('password').value;

//DELEGATION
if (mapBox){
const locations = JSON.parse(document.mapBox.dataset.locations);
console.log(locations);
 displayMap(locations);
}

if(loginForm){
loginForm.addEventListener('submit', e =>{
    e.preventDefault();
    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    login(email,password);

});
};

if(logOutBtn){
    logOutBtn.addEventListener('click', logout);
}

if(updateBtn){
    updateBtn.addEventListener('submit', e => {
        e.preventDefault();
        const form = new FormData();
        form.append('name', document.getElementById('name').value)
        form.append('email', document.getElementById('email').value)
        form.append('photo', document.getElementById('photo').files[0]);
        console.log(form);
        updateSettings(form, 'data');
    });
}

if(updatePassword){
    updatePassword.addEventListener('submit', async e => {

        e.preventDefault();
        document.querySelector('.btn--save-password').textContent = 'Updating...'

        const passwordCurrent = document.getElementById('password-current').value;
        const password = document.getElementById('password').value;
        const confirmPassword = document.getElementById('password-confirm').value;

       await  updateSettings({passwordCurrent, password, confirmPassword}, 'password');


       document.querySelector('.btn--save-password').textContent = 'Saved...'
       document.getElementById('password-current').value = '';
       document.getElementById('password').value = '';
       document.getElementById('password-confirm').value = '';
    })
}

myPromise.then( value=> {
    console.log(value)
 }).catch(err => {
     console.log(err);
 })
